const e=JSON.parse(`{"key":"v-41c9f2ae","path":"/lc649.html","title":"649. Dota2 参议院","lang":"en-US","frontmatter":{},"headers":[{"level":2,"title":"AC rating：48.1%","slug":"ac-rating-48-1","link":"#ac-rating-48-1","children":[{"level":3,"title":"题目","slug":"题目","link":"#题目","children":[]},{"level":3,"title":"示例","slug":"示例","link":"#示例","children":[]},{"level":3,"title":"解析","slug":"解析","link":"#解析","children":[]},{"level":3,"title":"代码","slug":"代码","link":"#代码","children":[]}]}],"git":{"createdTime":1686050296000,"updatedTime":1686050296000,"contributors":[{"name":"wildpants","email":"492843674@qq.com","commits":1}]},"readingTime":{"minutes":2.91,"words":874},"filePathRelative":"lc649.md","localizedDate":"June 6, 2023","excerpt":"<h1> 649. Dota2 参议院</h1>\\n<h2> AC rating：48.1%</h2>\\n<h3> 题目</h3>\\n<ul>\\n<li>\\n<p>Dota2 的世界里有两个阵营：<code>Radiant</code>（天辉）和&nbsp;<code>Dire</code>（夜魇）</p>\\n</li>\\n<li>\\n<p>Dota2 参议院由来自两派的参议员组成。现在参议院希望对一个 Dota2 游戏里的改变作出决定。他们以一个基于轮为过程的投票进行。在每一轮中，每一位参议员都可以行使两项权利中的 <strong>一</strong> 项：</p>\\n</li>\\n<li>\\n<p>禁止一名参议员的权利：参议员可以让另一位参议员在这一轮和随后的几轮中丧失 所有的权利 。</p>\\n<ul>\\n<li>宣布胜利：如果参议员发现有权利投票的参议员都是 同一个阵营的 ，他可以宣布胜利并决定在游戏中的有关变化。</li>\\n<li>给你一个字符串&nbsp;<code>senate</code> 代表每个参议员的阵营。字母 <code>'R'</code> 和 <code>'D'</code>分别代表了&nbsp;<code>Radiant</code>（天辉）和&nbsp;<code>Dire</code>（夜魇）。然后，如果有 <code>n</code> 个参议员，给定字符串的大小将是&nbsp;<code>n</code>。</li>\\n</ul>\\n</li>\\n<li>\\n<p>以轮为基础的过程从给定顺序的第一个参议员开始到最后一个参议员结束。这一过程将持续到投票结束。所有失去权利的参议员将在过程中被跳过。</p>\\n</li>\\n<li>\\n<p>假设每一位参议员都足够聪明，会为自己的政党做出最好的策略，你需要预测哪一方最终会宣布胜利并在 Dota2 游戏中决定改变。输出应该是&nbsp;<code>\\"Radiant\\"</code> 或 <code>\\"Dire\\"</code> 。</p>\\n</li>\\n</ul>"}`);export{e as data};
